import React, {useEffect, useState} from 'react';
import '../css/DutyPage.css'
import axios from "axios";
import GroupModal from "./modal/GroupModal";

const DutyPage = () => {
    const [duties, setDuties] = useState([])
    const [id, setId] = useState({})
    const [addVisible, setAddVisible] = useState(false);

    useEffect(() => {
        axios.get('http://localhost:2222/api/v1/duties/', {withCredentials:true}).then(res => {
                setDuties(res.data)
        }).catch(e => {
            console.log(e)
        })
    }, [])

    return (
        <div>
            <div className={"duty-page-container"}>
                <div className={"duty-page-title"}>Списки нарядів</div>
                <div className={"duty-page-table"}>
                    <div className={"duty-page-table-l1"}>
                        <div>№</div>
                        <div>Група що заступає</div>
                        <div>Дата заступання</div>
                    </div>
                    {duties.map((d, index) => (
                        <div className={"duty-page-table-l2"} key={d.id} onClick={() => {
                            setId(d.groupId)
                            setAddVisible(true)}
                        }>
                            <div>{index}</div>
                            <div>{d.groupId}</div>
                            <div>{d.date_of_substitution.split('T')[0]}</div>
                        </div>
                    ))}
                </div>
                <div>

                </div>
                <GroupModal show={addVisible} id={id} onClose={() => setAddVisible(false)}/>
            </div>
        </div>
    );
};

export default DutyPage;
